import React, { useState } from "react";
import Foodcard from "./Foodcard";
import "./style.css";
import Navbar from "./Navbar";
import Menu from "./menuApi"

const Hotel = () => {
  const [MenuData, setMenuData] = useState(Menu)
  
  return (
    <>
      <div className="container">
        
      <div className="nav">
        <div className="nav-menu">
          <button onClick={() => filterItem("breakfast")} >BreakFast</button>
          <span className="innerBut">
            <button onClick={() => filterItem("breakfast")}>Lunch</button>
            <button onClick={() => filterItem("breakfast")} >Evening</button>
            <button onClick={() => filterItem("breakfast")} >Dinner</button>
          </span>
          <span className="lastbut"><button onClick={() => filterItem("breakfast")} >All</button></span>
          
        </div>
      </div>
        <Foodcard MenuData={ MenuData}/>
        
      </div>
    </>
  );
};

export default Hotel;
